class VanillaBigAugmentedGui private constructor(
    player: ServerPlayerEntity,
    val shulkerInventory: Inventory,
    private val rows: Int,
    title: Text?,
    private val color: DyeColor?,
    private val maximized: Boolean,
    onInventoryOpen: Boolean,
) : SimpleGui(ScreenHandlerType.GENERIC_9X6, player, maximized) {
    private var scroll = 0

    private val up1: Pair<String, String>
    private val up2: Pair<String, String>
    private val up3: Pair<String, String>
    private val upStop: Pair<String, String>
    private val down1: Pair<String, String>
    private val down2: Pair<String, String>
    private val down3: Pair<String, String>
    private val downStop: Pair<String, String>
    private val maximize: Pair<String, String>
    private val minimize: Pair<String, String>

    internal constructor(
        player: ServerPlayerEntity,
        shulkerInventory: Inventory,
        rows: Int,
        title: Text,
        color: DyeColor?,
    ) : this(
        player,
        shulkerInventory,
        rows,
        title,
        color,
        maximized = false,
        onInventoryOpen = true,
    )

    init {
        this.title = title
        Optional.ofNullable(color).also {
            up1 = UP_1[it]!!
            up2 = UP_2[it]!!
            up3 = UP_3[it]!!
            upStop = UP_STOP[it]!!
            down1 = DOWN_1[it]!!
            down2 = DOWN_2[it]!!
            down3 = DOWN_3[it]!!
            downStop = DOWN_STOP[it]!!
            maximize = MAXIMIZE[it]!!
            minimize = MINIMIZE[it]!!
        }

        updateSlots()
        if (onInventoryOpen) shulkerInventory.onOpen(player)
    }

    private val actionsRow get() = 9 * (if (maximized) 9 else 5)
    private val maxScroll get() = rows - (if (maximized) 9 else 5)

    private fun updateSlots() {
        for (i in 0 until actionsRow) {
            if (i < shulkerInventory.size()) {
                setSlotRedirect(i, ShulkerBoxSlot(shulkerInventory, i + 9 * scroll, 0, 0))
            } else {
                setSlot(i, GuiElementBuilder.from(Items.GRAY_STAINED_GLASS_PANE.defaultStack).setName(Text.empty()))
            }
        }

        addScrollButton(0, Text.translatable("$MOD_ID.ui.big_augment_sgui.scroll_up_one"), -1, scroll <= 0, up1)
        addScrollButton(1, Text.translatable("$MOD_ID.ui.big_augment_sgui.scroll_down_one"), 1, scroll >= maxScroll, down1)
        addScrollButton(2, Text.translatable("$MOD_ID.ui.big_augment_sgui.scroll_up_two"), -2, scroll <= 0, up2)
        addScrollButton(3, Text.translatable("$MOD_ID.ui.big_augment_sgui.scroll_down_two"), 2, scroll >= maxScroll, down2)
        addScrollButton(4, Text.translatable("$MOD_ID.ui.big_augment_sgui.scroll_up_three"), -3, scroll <= 0, up3)
        addScrollButton(5, Text.translatable("$MOD_ID.ui.big_augment_sgui.scroll_down_three"), 3, scroll >= maxScroll, down3)
        addScrollButton(6, Text.translatable("$MOD_ID.ui.big_augment_sgui.scroll_to_top"), -rows, scroll <= 0, upStop)
        addScrollButton(7, Text.translatable("$MOD_ID.ui.big_augment_sgui.scroll_to_bottom"), rows, scroll >= maxScroll, downStop)

        setSlot(
            actionsRow + 8,
            GuiElementBuilder.from(Items.PLAYER_HEAD.defaultStack)
                .setSkullOwner(
                    if (maximized) minimize.first else maximize.first,
                    if (maximized) minimize.second else maximize.second,
                    null,
                )
                .setName(
                    Text.translatable("$MOD_ID.ui.big_augment_sgui.${if (maximized) "minimize" else "maximize"}")
                        .formatted(Formatting.GREEN),
                )
                .setLore(
                    if (maximized) {
                        listOf()
                    } else {
                        listOf(
                            Text.translatable("$MOD_ID.ui.big_augment_sgui.maximize.desc").formatted(Formatting.GRAY),
                        )
                    },
                )
                .setCallback { ->
                    click()
                    VanillaBigAugmentedGui(player, shulkerInventory, rows, title, color, !maximized, false).open()
                },
        )
    }

    private fun addScrollButton(
        slot: Int,
        name: MutableText,
        scrollAmount: Int,
        disabled: Boolean,
        texture: Pair<String, String>,
    ) {
        val button = GuiElementBuilder.from(Items.PLAYER_HEAD.defaultStack)
        if (disabled) {
            setSlot(actionsRow + slot, button.setName(name.formatted(Formatting.DARK_GRAY)).setSkullOwner(DISABLED))
        } else {
            setSlot(
                actionsRow + slot,
                button.setName(name.formatted(Formatting.GREEN))
                    .setSkullOwner(texture.first, texture.second, null)
                    .setCallback { -> scroll(scrollAmount) },
            )
        }
    }

    private fun scroll(amount: Int) {
        scroll = (scroll + amount).coerceIn(0, maxScroll)
        click()
        updateSlots()
    }

    private fun click() = player.playSound(SoundEvents.UI_BUTTON_CLICK.value(), SoundCategory.MASTER, 0.2f, 1f)

    override fun onClose() {
        super.onClose()
        shulkerInventory.onClose(player)
    }

    override fun onAnyClick(index: Int, type: ClickType?, action: SlotActionType?): Boolean = !maximized

